def process_results(doc, results):
    candidates = results[0]
    pred = clean_output(candidates, doc["meal_description"], "cot", "carb")
    gt = doc["carb"]
    mae = abs(pred - gt)

    results = {
        "acc": mae < 7.5,
        "mae": mae,
    }
    return results

